import React, { useEffect, useState, useContext } from 'react'

import { publicFetch } from '../../../util/fetcher'
import { GroupAuthContext } from '../../../store/groupauth'
import PageTitle from '../../page-title'
import SearchInput from '../../search-input'
import UserList from '../../user-list'
import UserItem from '../../user-list/user-item-group'

import { Spinner } from '../../icons'
import styles from '../usergroup.module.css'

const UsersManage = () => {
    const [searchTerm, setSearchTerm] = useState(null)
    const [users, setUsers] = useState(null)
    const [waitList, setWaitList] = useState(null)
    const [listAdmin, setListAdmin] = useState(null)
    const [loading, setLoading] = useState(false)

    const { valueGroup } = useContext(GroupAuthContext)

    const fetchListWait = () => {
        if (searchTerm === null) {
            const fetchUser = async () => {
                const { data } = await publicFetch.get(`/group/${valueGroup.inGroup}/waitlistuser`)
                setWaitList(data)
            }
            fetchUser()
        }
    }
    const fetchAdminList = () => {
        if (searchTerm === null) {
            const fetchUser = async () => {
                const { data } = await publicFetch.get(`/group/${valueGroup.inGroup}/adminlist`)
                setListAdmin(data)
            }
            fetchUser()
        }
    }
    const fetchListMember = (searchTerm) => {
        if (searchTerm === null) {
            const fetchUser = async () => {
                const { data } = await publicFetch.get(`/group/${valueGroup.inGroup}/member`)
                setUsers(data)
            }
            fetchUser()
        } else {
            const delayDebounceFn = setTimeout(async () => {
                setLoading(true)
                const { data } = await publicFetch.get(
                    searchTerm ? `/users/${searchTerm}` : `/users`
                )
                setUsers(data)
                setLoading(false)
            }, 500)

            return () => clearTimeout(delayDebounceFn)
        }
    }
    useEffect(() => {
        fetchListWait()
        fetchAdminList()
        fetchListMember(searchTerm)
    }, [searchTerm])


    return (
        <div className="containerusergroup">
    {/* Left Column */}
    <div className="left-column">
        <div>
            <PageTitle title="Request to join group" borderBottom={false} />
            {!waitList && (
                <div className="loading">
                    <Spinner />
                </div>
            )}
            {waitList && (
                <>
                    <UserList>
                        {waitList?.map(({ username, profilePhoto, id }) => (
                            <UserItem
                                key={id}
                                username={username}
                                profilePhoto={profilePhoto}
                                group={valueGroup.inGroup}
                                outGroup={true}
                            />
                        ))}
                    </UserList>
                    {waitList.length == 0 && (
                        <p className="not-found">No request yet</p>
                    )}
                </>
            )}
        </div>

        <div>
            <PageTitle title="Member in group" borderBottom={false} />
            <SearchInput
                placeholder="Search by user"
                isLoading={loading}
                autoFocus
                autoComplete="off"
                type="text"
                onChange={(e) => setSearchTerm(e.target.value)}
            />
            {!users && (
                <div className="loading">
                    <Spinner />
                </div>
            )}
            {users && (
                <>
                    <UserList>
                        {users?.map(({ username, profilePhoto, id }) => (
                            <UserItem
                                key={id}
                                username={username}
                                profilePhoto={profilePhoto}
                                group={valueGroup.inGroup}
                                inGroup={true}
                                outGroup={false}
                            />
                        ))}
                    </UserList>
                    {users.length == 0 && (
                        <p className="not-found">No users matched your search.</p>
                    )}
                </>
            )}
        </div>
    </div>

    {/* Right Column */}
    {valueGroup.isAuthor && (
        <div className="right-column">
            <PageTitle title="List Admin" borderBottom={false} />
            {!listAdmin && (
                <div className="loading">
                    <Spinner />
                </div>
            )}
            {listAdmin && (
                <>
                    <UserList>
                        {listAdmin?.map(({ username, profilePhoto, id }) => (
                            <UserItem
                                key={id}
                                username={username}
                                profilePhoto={profilePhoto}
                                group={valueGroup.inGroup}
                                inGroup={false}
                                outGroup={false}
                                admin={true}
                            />
                        ))}
                    </UserList>
                    {listAdmin.length == 0 && (
                        <p className="not-found">Add admin to your group.</p>
                    )}
                </>
            )}
        </div>
    )}
</div>


    )
}

export default UsersManage
